import { useNavigate } from "react-router-dom"
import { Button } from "semantic-ui-react"

function Welcome() {

    const navigate = useNavigate()

    const handleClick = ()=>{
        navigate.push("/new-game")
    }

    return(
        <div>
            <h1>Quiz Show</h1>

            <Button onClick={handleClick}>
      Start Trivia Game
    </Button>
        </div>
    )
}

export default Welcome
